	(798,14,2,'Contactez-nous','2018-09-21 12:15:31','2019-01-02 17:49:05','95bb33ed-f2d3-4980-b052-acdf719bb85c',NULL,NULL,NULL,NULL,NULL,'Addresse Heading','Contact Title',NULL,'<p>Lorem <a href=\"{entry:2:url}\">ispum</a> dolor site amet.</p>','{\"lat\":\"45.50386\",\"lng\":\"-73.56096889999998\",\"location\":\"Montreal Convention Centre, Montreal, QC, Canada\",\"placeid\":\"ChIJCRWEZloayUwRU0xKEh4ENGQ\",\"locationData\":{\"address_components\":[{\"long_name\":\"Montréal\",\"short_name\":\"Montréal\",\"types\":[\"locality\",\"political\"]},{\"long_name\":\"Ville-Marie\",\"short_name\":\"Ville-Marie\",\"types\":[\"sublocality_level_1\",\"sublocality\",\"political\"]},{\"long_name\":\"Communauté-Urbaine-de-Montréal\",\"short_name\":\"Communauté-Urbaine-de-Montréal\",\"types\":[\"administrative_area_level_2\",\"political\"]},{\"long_name\":\"Québec\",\"short_name\":\"QC\",\"types\":[\"administrative_area_level_1\",\"political\"]},{\"long_name\":\"Canada\",\"short_name\":\"CA\",\"types\":[\"country\",\"political\"]},{\"long_name\":\"H2Z 1H5\",\"short_name\":\"H2Z 1H5\",\"types\":[\"postal_code\"]}],\"adr_address\":\"1001 Jean Paul Riopelle Pl, Montreal, QC H2Z 1H5 Place Jean-Paul-Riopelle, <span class=\\\"locality\\\">Montréal</span>, <span class=\\\"region\\\">QC</span> <span class=\\\"postal-code\\\">H2Z 1H5</span>, <span class=\\\"country-name\\\">Canada</span>\",\"formatted_address\":\"1001 Jean Paul Riopelle Pl, Montreal, QC H2Z 1H5 Place Jean-Paul-Riopelle, Montréal, QC H2Z 1H5, Canada\",\"formatted_phone_number\":\"(514) 871-8122\",\"geometry\":{\"location\":{\"lat\":45.50386,\"lng\":-73.5609689},\"viewport\":{\"south\":45.5020326,\"west\":-73.56259255,\"north\":45.5076314,\"east\":-73.55819755}},\"icon\":\"https://maps.gstatic.com/mapfiles/place_api/icons/generic_business-71.png\",\"id\":\"b0be11b1f91c87259ad2384f8fc3b24b4f919871\",\"international_phone_number\":\"+1 514-871-8122\",\"name\":\"Montreal Convention Centre\",\"opening_hours\":{\"open_now\":true,\"periods\":[{\"open\":{\"day\":0,\"time\":\"0000\",\"hours\":0,\"minutes\":0,\"nextDate\":1537675200000}}],\"weekday_text\":[\"Monday: Open 24 hours\",\"Tuesday: Open 24 hours\",\"Wednesday: Open 24 hours\",\"Thursday: Open 24 hours\",\"Friday: Open 24 hours\",\"Saturday: Open 24 hours\",\"Sunday: Open 24 hours\"]},\"photos\":[{\"height\":1687,\"html_attributions\":[\"<a href=\\\"https://maps.google.com/maps/contrib/101259539875154097385/photos\\\">Palais des congrès de Montréal</a>\"],\"width\":2048},{\"height\":2448,\"html_attributions\":[\"<a href=\\\"https://maps.google.com/maps/contrib/102072376654417659890/photos\\\">BUZZ DUR</a>\"],\"width\":3264},{\"height\":2448,\"html_attributions\":[\"<a href=\\\"https://maps.google.com/maps/contrib/116140829326322477083/photos\\\">YAHUWA MESSENGER</a>\"],\"width\":3264},{\"height\":2976,\"html_attributions\":[\"<a href=\\\"https://maps.google.com/maps/contrib/105676620700235699211/photos\\\">Laurent Valcourt</a>\"],\"width\":3968},{\"height\":3024,\"html_attributions\":[\"<a href=\\\"https://maps.google.com/maps/contrib/114518082350842569625/photos\\\">Daniel Cote</a>\"],\"width\":4032},{\"height\":3096,\"html_attributions\":[\"<a href=\\\"https://maps.google.com/maps/contrib/117558921199448677396/photos\\\">Jehyun Yang</a>\"],\"width\":4128},{\"height\":2592,\"html_attributions\":[\"<a href=\\\"https://maps.google.com/maps/contrib/114526222459635846230/photos\\\">Eko Rudiawan Jamzuri</a>\"],\"width\":3872},{\"height\":4032,\"html_attributions\":[\"<a href=\\\"https://maps.google.com/maps/contrib/113181197626258049566/photos\\\">Nad Rodríguez</a>\"],\"width\":3024},{\"height\":1836,\"html_attributions\":[\"<a href=\\\"https://maps.google.com/maps/contrib/101823500408949629218/photos\\\">Alex Mykhailenko</a>\"],\"width\":3264},{\"height\":2988,\"html_attributions\":[\"<a href=\\\"https://maps.google.com/maps/contrib/112903701978082344192/photos\\\">Oscar Flores Chapa Jimenez</a>\"],\"width\":5312}],\"place_id\":\"ChIJCRWEZloayUwRU0xKEh4ENGQ\",\"plus_code\":{\"compound_code\":\"GC3Q+GJ Montreal, Quebec, Canada\",\"global_code\":\"87Q8GC3Q+GJ\"},\"rating\":4.3,\"reference\":\"ChIJCRWEZloayUwRU0xKEh4ENGQ\",\"reviews\":[{\"author_name\":\"Alyssa Becker\",\"author_url\":\"https://www.google.com/maps/contrib/110550791785146416582/reviews\",\"language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/-c39tK0mnnbc/AAAAAAAAAAI/AAAAAAAAAdA/J58DYwdl1RM/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg\",\"rating\":4,\"relative_time_description\":\"3 weeks ago\",\"text\":\"Quirky building with stores and quick service/fast-food restaurants on the main level.  We stayed at a hotel near by and didn\'t know what the building was, and had to look it up.  Went here to grab some snacks and drinks.  Fun to photograph from the outside given it\'s colourful exterior.\",\"time\":1535333072},{\"author_name\":\"Natalie Piggott Nardozza\",\"author_url\":\"https://www.google.com/maps/contrib/100066104830607028408/reviews\",\"language\":\"en\",\"profile_photo_url\":\"https://lh6.googleusercontent.com/-0ITfFAAN52M/AAAAAAAAAAI/AAAAAAAAdVI/DqrU6MB9YFU/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg\",\"rating\":4,\"relative_time_description\":\"3 weeks ago\",\"text\":\"Good for events I\'ve been to. Easy to get around. Bathrooms (not especially including the ones on the ground floor) are spacious and well-kept. Variety of places to find food inside the convention center. Very convenient that it is directly connected to the Place D\'armes metro station.\",\"time\":1535164347},{\"author_name\":\"Ian A.\",\"author_url\":\"https://www.google.com/maps/contrib/109412613438615643419/reviews\",\"language\":\"en\",\"profile_photo_url\":\"https://lh4.googleusercontent.com/-iyB9rARw6cI/AAAAAAAAAAI/AAAAAAAAAAA/AAN31DUusmxsJ682sSe2KMk91xL-jgD9lg/s128-c0x00000000-cc-rp-mo/photo.jpg\",\"rating\":4,\"relative_time_description\":\"a month ago\",\"text\":\"I went there for the Montreal Comic-Con. It was great. Excellent service, a lot of space, lots of restrooms and everything well-indicated (they had an app too).\\n\\nTheres access for people with reduced mobility.\\n\\nDespite the intense crowd, I didn\'t even feel hot because the place has good AC.\\n\\nGetting a parking space might be a little difficult. You might want to plan in advance.\",\"time\":1533410104},{\"author_name\":\"Bianca-Lauren Huhn\",\"author_url\":\"https://www.google.com/maps/contrib/105944825661786560862/reviews\",\"language\":\"en\",\"profile_photo_url\":\"https://lh6.googleusercontent.com/-omWSQOHjgvY/AAAAAAAAAAI/AAAAAAAAAAA/AAN31DXW6w69UNxMmiFyrS02FVJVrpMCLA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg\",\"rating\":5,\"relative_time_description\":\"a month ago\",\"text\":\"Great space for large events. Worked there a few times. A lot of bathroom access and wheelchair access. Direct metro access at place d\'armes. Restaurants and cafes.\",\"time\":1533782763},{\"author_name\":\"Guy Pylypiw\",\"author_url\":\"https://www.google.com/maps/contrib/111192117331786232581/reviews\",\"language\":\"en\",\"profile_photo_url\":\"https://lh4.googleusercontent.com/-pnJJ_FF0s8E/AAAAAAAAAAI/AAAAAAAAB9s/BoGUCVdspxc/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg\",\"rating\":3,\"relative_time_description\":\"a month ago\",\"text\":\"Convenient location and service of staff was good. Building is looking very dated and could use a refresh. Food provided was ok. Coffee provided was not very good.\",\"time\":1532883220}],\"scope\":\"GOOGLE\",\"types\":[\"point_of_interest\",\"establishment\"],\"url\":\"https://maps.google.com/?cid=7220400629784136787\",\"utc_offset\":-240,\"vicinity\":\"1001 Jean Paul Riopelle Pl, Montreal, QC H2Z 1H5 Place Jean-Paul-Riopelle, Montréal\",\"website\":\"http://congresmtl.com/\",\"html_attributions\":[],\"components\":{\"locality\":\"Montréal\",\"locality_short\":\"Montréal\",\"sublocality_level_1\":\"Ville-Marie\",\"sublocality_level_1_short\":\"Ville-Marie\",\"administrative_area_level_2\":\"Communauté-Urbaine-de-Montréal\",\"administrative_area_level_2_short\":\"Communauté-Urbaine-de-Montréal\",\"administrative_area_level_1\":\"Québec\",\"administrative_area_level_1_short\":\"QC\",\"country\":\"Canada\",\"country_short\":\"CA\",\"postal_code\":\"H2Z 1H5\",\"postal_code_short\":\"H2Z 1H5\"}}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
