	(801,77,2,'Lesley Fennelly','2018-09-21 12:17:00','2019-02-03 20:25:43','9d971cb8-c1ef-4135-9a0b-807a3f9ac84d','Marketing Manager at Toronto Finance International','lfennelly@tfi.ca','+1 416 933 6788','https://www.linkedin.com/in/lesley-fennelly/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Sophie Gupta is a Principal at Yaletown Partners, an impact-focused venture capital fund manager that invests in businesses developing technologies to digitally transform traditional ...','<p>Sophie Gupta is a Principal at Yaletown Partners, an impact-focused venture capital fund manager that invests in businesses developing technologies to digitally transform traditional industries by prioritizing climate resilient growth for an innovative and sustainable future.</p>\n<p>In addition to her work as an investment professional, Sophie is the Co-Founder of the Gupta Family Foundation, mandated to support the empowerment of girls and women through educational and economic advancement opportunities. Sophie has served on the Board of Directors of The MATCH International Women’s Fund and the Canadian Women’s Foundation. She is currently the Co-Chair of the Canadian Venture Capital Association’s (CVCA) Diversity and Inclusion Committee and serves on the Board of Engineers Without Borders.</p>\n<p>Sophie holds a Bachelor of Laws from Université Laval, as well as an Honours Bachelor of Commerce (specializing in International Business) from the University of Ottawa and lives in Montréal, Québec.</p>'),
