	(859,631,1,'Cookie Policy','2018-12-21 15:44:34','2018-12-21 16:03:11','86914975-66d9-4c78-8252-79021cb5d938',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<h2>WHAT ARE COOKIES AND WHY DO WE USE THEM?</h2>\n<p>Cookies are small text files that are placed onto your computer by websites and/or applications that you visit. Cookies are used to help us improve your experience when using our websites – for example, storing your preferred language setting for the next time you visit.</p>\n<p>The information we collect from cookies enables us to:</p>\n<ul><li>Tailor our websites to your personal needs</li><li>Remember the notifications that you have been shown, so that you are not shown them again</li><li>Make improvements and updates to our websites based on the way you want to use them</li></ul><p>We generally do not use cookies to identify you personally.</p>\n<h2>WHAT KIND OF COOKIES DO WE USE?</h2>\n<p>We use the following categories of cookies:</p>\n<p><strong>Category 1: necessary cookies</strong><br />Necessary cookies enable you to use our websites and all their features, such as enabling access to secure areas of the website. Without these cookies you may not be able to use all the features of our websites.</p>\n<p><strong>Category 2: performance cookies</strong><br />Performance cookies collect information about how you use our websites so we can improve them for you in future. For example, they collect information on which pages you visit most often and any error messages you may get. The information collected by these cookies is anonymous. They do not collect any information that can identify you personally.</p>\n<ul><li><strong>Google Analytics (universal):</strong> we are using Google Universal Analytics to monitor our website performances and check visitor activities to adapt our content based on their expectations<br /></li><li><strong>Hotjar:</strong> we are using Hotjar to validate that our website design and user experience are performing as expected and offer the best possible experience to our visitors. We also use it to perform surveys on pages and collect visitor feedback, when they want to share it with us</li></ul><p><strong>Category 3: functionality cookies</strong><br />Functionality cookies enable us to provide you with a more personalized experience. They help us to remember data, such as your username and language preference, to save you having to enter them again the next time you visit. The information these cookies collect is anonymous. They cannot track your browsing activity on other websites.</p>\n<p><strong>Category 4: targeting/advertising cookies</strong><br />We and our service providers may use advertising cookies to deliver ads that we believe are relevant to you and your interests.</p>\n<p>For example, we may use targeting or advertising cookies to customize the advertising and content you receive on our websites, to limit the number of times you see the same ad on our websites and to help measure the effectiveness of our advertising campaigns.</p>\n<ul><li><strong>Facebook Pixel:</strong> we use Facebook pixel tracking to measure social media campaign efficiency related to the Facebook platform</li></ul><p>No Personally Identifiable information is stored in any of the platforms mentioned above. </p>\n<p><strong>Category 5: social media cookies</strong><br />We use third-party cookies from social media sites such as Facebook, Twitter and LinkedIn to enable in-depth campaign reporting and to track social network users when they visit our websites, by using a tagging mechanism provided by those social networks. These cookies can also be used for event tracking and remarketing purposes. Any data collected with these tags will be used in accordance with the privacy policy and with the social network\'s privacy policies. We will not collect or store any personally identifiable information from the user.</p>\n<ul><li>LinkedIn: we use LinkedIn tracking to measure social media campaign efficiency related to the LinkedIn platform</li><li>Twitter: we use Twitter tracking to measure social media campaign efficiency related to the twitter platform</li></ul><p>Details of how you can opt out of accepting these cookies are found in the following links:</p>\n<ul><li><a href=\"https://support.twitter.com/articles/20170514\" target=\"_blank\" rel=\"noreferrer noopener\">Twitter</a></li><li><a href=\"https://www.linkedin.com/legal/cookie-policy?trk=hp-cookies\" target=\"_blank\" rel=\"noreferrer noopener\">Linkedin</a></li></ul>',NULL,NULL,NULL),
	(860,631,2,'Politique d\'utilisation des cookies','2018-12-21 15:44:34','2018-12-21 16:03:11','405cd613-59e1-432c-9fe5-98112df80eba',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<h2>QUE SONT LES COOKIES ET POURQUOI LES UTILISONS-NOUS ?</h2>\n<p>Les cookies sont de petits fichiers texte installés sur votre ordinateur par les sites Web et/ou les applications que vous visitez ou utilisez. Les cookies nous permettent d\'améliorer l\'expérience de l\'utilisateur sur nos sites Web. Ainsi, nous pouvons par exemple mémoriser vos options de langue pour votre prochaine visite.</p>\n<p>Les informations collectées par les cookies nous permettent :</p>\n<ul><li>d\'adapter nos sites Web à vos besoins personnels ;</li><li>de mémoriser les notifications que vous avez visualisées, afin qu\'elles ne s\'affichent plus ;</li><li>d\'améliorer et de mettre à jour nos sites Web en fonction de vos attentes concernant leur utilisation.</li></ul><p>Nous n\'utilisons généralement pas de cookies permettant de vous identifier personnellement.</p>\n<h2>QUELS TYPES DE COOKIES UTILISONS-NOUS ?</h2>\n<p>Nous utilisons les catégories de cookies suivantes :</p>\n<p><strong>Catégorie 1 : cookies nécessaires</strong><br />Les cookies nécessaires vous permettent de naviguer sur nos sites Web et de profiter de leurs fonctionnalités, par exemple pour accéder aux espaces sécurisés du site. Sans ces cookies, vous ne pourriez pas profiter de toutes les fonctionnalités de nos sites Web.</p>\n<p><strong>Catégorie 2 : cookies de performance</strong><br />Les cookies de performance collectent des informations sur la manière dont vous utilisez nos sites Web et nous permettent de les améliorer à l\'avenir. Par exemple, ils collectent des informations sur les pages que vous visitez le plus et sur les messages d\'erreur que vous pouvez rencontrer. Les informations recueillies par ces cookies sont complètement anonymes. Ils ne collectent aucune information qui pourrait permettre de vous identifier personnellement.</p>\n<ul><li><strong>Google Analytics (universal) :</strong> nous utilisons Google Universal Analytics pour suivre les performances de notre site Web et l\'activité des visiteurs afin d\'adapter notre contenu à leurs attentes.<br /></li><li><strong>Hotjar :</strong> nous utilisons Hotjar pour valider la conception de notre site Web et vérifier que l\'expérience utilisateur est conforme aux attentes et que le site offre la meilleure expérience possible à nos visiteurs. Nous l\'utilisons également pour réaliser des sondages sur nos pages et collecter des retours d\'utilisateurs lorsque ces derniers acceptent de nous en faire part.</li></ul><p><strong>Catégorie 3 : cookies fonctionnels</strong><br />Les cookies fonctionnels nous permettent de vous offrir une expérience plus personnalisée. Ils sont utilisés pour mémoriser des informations telles que votre nom d\'utilisateur ou vos choix de langue, afin de vous éviter de saisir ces données à chaque visite. Les informations recueillies par ces cookies sont complètement anonymes. Ils ne peuvent en aucun cas enregistrer vos données de navigation sur d\'autres sites Web.</p>\n<p><strong>Catégorie 4 : cookies publicitaires/ciblés</strong><br />Nous et nos prestataires de services pouvons utiliser des cookies publicitaires pour vous présenter des publicités qui, selon nous, peuvent vous correspondre et correspondre à vos centres d\'intérêt.</p>\n<p>Par exemple, nous pouvons utiliser des cookies publicitaires/ciblés pour personnaliser la publicité et le contenu que vous recevez sur nos sites Web, pour limiter le nombre de fois qu\'une même publicité vous est proposée sur nos sites et pour nous aider à évaluer l\'efficacité de nos campagnes publicitaires.</p>\n<ul><li><strong>Facebook Pixel :</strong> nous utilisons le traceur de pixels Facebook pour mesurer l\'efficacité des campagnes de réseau social sur la plateforme Facebook.</li></ul><p>Aucune information permettant de vous identifier personnellement n\'est stockée sur aucune des plateformes mentionnées ci-dessus. </p>\n<p><strong>Catégorie 5 : cookies de réseaux sociaux</strong><br />Nous utilisons des cookies tiers issus de Facebook, Twitter et LinkedIn pour obtenir des rapports de campagne détaillés et suivre les usagers des réseaux sociaux lorsqu\'ils visitent nos sites Web, en utilisant un mécanisme de balisage fourni par ces réseaux sociaux. Ces cookies peuvent aussi être utilisés pour suivre des événements ou à des fins de reciblage publicitaire. Toutes les données collectées à l\'aide de ces balises seront utilisées conformément à la politique de confidentialité et aux politiques de confidentialité des réseaux sociaux. Les sites Web de SGS ne collectent et ne conservent aucune information à caractère personnel de l\'utilisateur.</p>\n<ul><li>LinkedIn : nous utilisons le suivi LinkedIn pour mesurer l\'efficacité des campagnes de réseau social sur la plateforme LinkedIn.</li><li>Twitter : nous utilisons le suivi Twitter pour mesurer l\'efficacité des campagnes de réseau social sur la plateforme Twitter.</li></ul><p>Pour savoir comment vous pouvez faire le choix de ne plus accepter ces cookies, consultez les liens suivants :</p>\n<ul><li><a href=\"https://support.twitter.com/articles/20170514\" target=\"_blank\" rel=\"noreferrer noopener\">Twitter</a></li><li><a href=\"https://www.linkedin.com/legal/cookie-policy?trk=hp-cookies\" target=\"_blank\" rel=\"noreferrer noopener\">Linkedin</a></li></ul>',NULL,NULL,NULL),
