	(13,44,1,'2018-06-30 12:34:26','2018-07-17 19:10:05','6ac8503b-c2f8-4dd3-b151-da27d360cc02','About TFI','<p><strong>Toronto Finance International is a public-private partnership between Canada’s largest financial services institutions and the government. Our organization is the lead voice for the international promotion of the Toronto Financial Centre and the global prominence of our financial services sector. </strong></p>\n<p>TFI also acts as a hub for Toronto’s financial sector and works with our stakeholders on initiatives which drive the growth and competitiveness of the industry.</p>\n<p>Our work spans from helping global financial services firms expand their operations in the Toronto Financial Centre, to working with the financial community, government and academia to foster a globally competitive sector which drives the economic growth of Canada.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
