es. You may not assign this Agreement or your rights and obligations under this Agreement without the express prior written consent of TFSA which may be withheld in TFSA\'s sole discretion. TFSA may assign this Agreement and its rights and obligations under this Agreement without your consent.</p><p>No consent or waiver by either party to or of any breach or default by the other party in its performance of its obligations under this Agreement will be deemed or construed to be a consent to or waiver of a continuing breach or default or any other breach or default of those or any other obligations of that party. No consent or waiver will be effective unless in writing and signed by both parties.</p><p>The parties have expressly requested and required that this Agreement and all other related documents be drawn up in the English language. Les parties conviennent et exigent expressement que ce Contrat et tous les documents qui s\'y rapportent soient rediges en anglais.</p><p>FROM TIME TO TIME, TFSA PROVIDES SERVICES TO MEMBERS SUCH AS INVITATIONS TO MEMBERS ONLY EVENTS AND ONE ON ONE MEETINGS WITH TFSA STAFF. MEMBERS UNDERSTAND THAT TFSA IS MAKING NO REPRESENTATIONS OR WARRANTIES WITH RESPECT TO SUCH SERVICES AND IS NOT RESPONSIBLE FOR ANY ACTIONS OR INACTIONS TAKEN BY MEMBERS RELATING TO SUCH SERVICES.</p></li></ol>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(26,97,1,'2018-07-04 11:38:23','2018-09-21 12:16:12','7afa64c2-9f94-4afe-85dd-074feab53705','Privacy Policy','<p>Your privacy is important to us. This Privacy Policy covers the information you provide to us online through our website located at <a href=\"http://www.tfsa.ca\">www.tfsa.ca</a> (“Site”). It also explains how we use cookies and similar technologies. By visiting our Site, you agree to be bound by the terms of this Privacy Policy.</p>\n<p><strong>Collection and Use</strong>. We collect the personal information you provide us when you make an inquiry through our Site. We use the information only to answer your questions and respond to your requests. When you visit our Site, we collect technical data, including your IP address, the browser you used to view our Site, your operating system, screen resolution, location, language settings, the site you came from and your keyword search. We aggregate this technical data and use it to improve our Site. We do not combine this technical data with your personal information. You can block the use of cookies by activating the settings in your browser but if you choose to block cookies, you may not be able to access all or part of our Site.</p>\n<p><strong>Sharing</strong>. We do not sell or rent your personal information to any third party. We share your personal information with third-party service providers that we engage to help us with our Site or business. These service providers are subject to confidentiality agreements with us and other legal restrictions that prohibit their use of your personal information for any purpose other than to assist us with our Site or business. We might be required to provide your personal information in response to a valid court order, subpoena, government investigation, or as otherwise required by law. We might report to law enforcement agencies any activities that we, in good faith, believe to be unlawful. We might release your personal information when we believe that such release is reasonably necessary to protect the rights, property and safety of others and ourselves. In some cases, your personal information may be processed or stored outside Canada and available to government authorities under lawful orders and laws applicable there.</p>\n<p><strong>Security</strong>. We use reasonable security measures to protect your personal information from unauthorized access. Please be careful when sending your personal information to us through e-mail. E-mail is not a secure means of transferring information. We cannot guarantee that emailed information will not be lost or stolen.</p>\n<p><strong>Accountability</strong>. We comply with this Privacy Policy and applicable privacy laws. If you send us a written complaint, we will contact you to follow up. We will work with the appropriate privacy commissioner to resolve any complaints that we cannot resolve directly with you.</p>\n<p><strong>Change of Privacy Policy</strong>. If we change our Privacy Policy, we will post a revised policy on this Site. Regardless of any change we make to our Privacy Policy, we will only use your personal information in accordance with the version in place at the time your personal information was provided to us, unless we have express consent to do otherwise.</p>\n<p><strong>Contact Person</strong>. If you have questions or concerns about this Privacy Policy, our privacy practices or your personal information, please contact: ktam@tfsa.ca</p>\n<p>If you ask us to delete your personal information, unless restricted by law, we will take reasonable steps to functionally delete your personal information from our database, although we may keep a copy for archival purposes for as long as necessary, in our opinion, in compliance with applicable laws. We will respond to your questions or concerns within 30 business days. Before we can respond we might ask you to verify your identity and to provide other details (in a secure manner) to help us to respond to your request.</p>\n<p>This Privacy Policy was last updated on April 15, 2016.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
