	(36,448,1,'2018-07-13 15:36:16','2018-07-13 15:36:16','490e3902-e937-4a49-9114-9deb383d7501','Banking','<p>Toronto is home to the world’s soundest banks. According to The Banker’s 2017 report on international financial centres Toronto ranked eighth overall and among the world’s top 10 for total bank assets.</p>\n<p>The Canadian banking industry, headquartered in Toronto, is an essential contributor to the economic growth and well-being of the city. Canada’s five largest domestic banks have their head offices in Toronto. Of the 50 foreign-based banks operating in Canada, 44 have their Canadian head offices in the Toronto region. The industry is also a major employer, representing almost half of total employment within the city’s financial sector.</p>\n<p>The Canadian system has two primary regulators: the Office of the Superintendent of Financial Institutions (OSFI) for prudential regulation and the Financial Consumer Agency of Canada (FCAC) for financial consumer matters.</p>\n<p>Coupled with a strong working relationship among regulators, the industry and government, the stability and effectiveness of our regulatory framework makes Toronto an attractive banking environment.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(37,449,1,'2018-07-13 15:36:16','2018-07-13 15:36:16','a2efa122-1983-4de5-8b48-d83c469cb02c','Asset management','<p>Toronto has a large pool of competitive asset management companies and expertise. It has ranked ninth in the world for its specialty in investment management and ninth in professional services (<a href=\"http://www.longfinance.net/images/gfci/20/GFCI20_26Sep2016.pdf\">GFCI 20 - 2016</a>).</p>\n<p>Toronto is also home to three of the world’s 60 largest pension funds – Canada Pension Plan (CPP) Investment Board, Ontario Teachers’ Pension Plan and OMERS – which combined have more than $300 billion in assets under management. Toronto’s large pension funds have a worldwide reputation for excellence in governance, risk management and innovative approaches to asset management. The Canadian pension system has been ranked 6th overall in the Melbourne Mercer Global Pension Index.</p>\n<p>Toronto also has a leading-edge thinking and research on pension management through <a href=\"http://www.rijpm.com/\" target=\"_blank\" rel=\"noreferrer noopener\">International Centre for Pension Management</a>. The ICPM is a global think-tank that fosters more effective pension design and management through research, publications, forums and governance education. More than 30 international pension organizations contribute to the centre.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(38,450,1,'2018-07-13 15:36:16','2018-07-13 15:36:16','5e624930-c802-47d0-9a8b-cd00dc06ed28','Insurance','<p>The strongest and most globally oriented insurance industries in the world are taking place in Toronto. It is continuously developing innovative products to reflect and anticipate the changing consumer needs and expectations.<br /></p>\n<p>Over 60 life and health insurers have their head offices in the Toronto region. Three of these firms – Manulife Financial, Sun Life Financial and Great West Lifeco – rank among the top 15 in the world, based on market capitalization. With over $740 billion in long-term investments in Canada, the industry is one of the country’s most important sources of long-term capital and employment.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(39,451,1,'2018-07-13 15:36:16','2018-07-13 15:36:16','214d3d10-be65-4fd9-96ed-620834c34f9d','Mining/Energy and clean tech','<p>Toronto is the mine financing capital of the world. It is also a global centre for related legal, accounting, engineering and geological expertise. Toronto Stock Exchange (TSX) and the TSX Venture Exchange (TSXV) are:<br /></p>\n<ul><li>#1 among exchanges worldwide in number of mining companies listed</li><li>#1 among exchanges worldwide in equity capital raised</li><li>Home to 43 per cent of the world’s public mining companies</li><li>Global leaders in the number of listed oil and gas and clean technology companies</li><li>Financing a cleaner, greener future</li></ul><p>The TSX and TSXV in 2015 saw:</p>\n<ul><li>29 new mining listings</li><li>40 billion shares traded</li><li>$6.8 billion in equity capital raised representing 90 per cent of all global equity financings</li></ul>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(40,452,1,'2018-07-13 15:36:16','2018-07-13 15:36:16','9a465832-6d82-4620-bcd0-583d02381d60','Fintech','<p>Location, tech talent, and competitive business environment: Toronto has all the ingredients to create a world-class Fintech cluster.</p>\n<p>More than 13,000 Tech companies in the Toronto region, from startups to global technology leaders, deliver hardware, software, and communications services to the North American and global financial services industry. A recent Deloitte report ranked Canada has the 4th largest cybersecurity hub in terms of deal flow with Ontario leading the country.</p>\n<p>The Toronto region is the Canadian headquarters for some of the world’s leading wireless and telecom companies, including Cisco, Ericsson and Alcatel, and for world-leading software and data analytics companies such as HP, IBM and Microsoft.Together, these companies contribute to Ontario’s nation-leading ICT sector, which accounts for 65% of the sector’s R&amp;D and 66% of its exports in Canada.</p>\n<p>With 50% of the country’s approximate 60,000 Fintech employees, the Toronto region offers one of the most highly educated workforces in the developed world. While more than 80% of Toronto’s financial services workers have post-secondary degrees and accreditations, the city’s 61 technology related programs train more than 5,000 graduates a year.</p>\n<p>Toronto’s talent pipeline is continually replenished by Ontario’s 44 colleges and universities that produce approximately 38,000 skilled graduates in science, technology, engineering and mathematics each year. They also offer more than 200 cooperative education programs in ICT fields, including the University of Waterloo’s program, the largest in the world, involving 19,000 students and 6,300 employers.</p>\n<p>Fintech companies doing business in Toronto benefit from one of the lowest software development costs in the industrialized world. Running a software development centre in Toronto is much more affordable than in London and New York City which is one of the many reasons why the Canadian software industry has grown 23% from 2009 to 2014. Based on the combined costs of labour, utilities, telecommunications and property, the cost of operating a data centre is also more affordable in Toronto than other jurisdictions.</p>\n<p>Toronto’s Fintech sector can also take advantage of a broadly based system of R&amp;D tax credits from the federal and provincial governments. These can reduce the gross cost of C$100 in R&amp;D to C$42 to C$54 depending on the size and type of company.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(41,453,1,'2018-07-13 15:36:16','2018-07-13 15:36:16','c81d380f-e467-4b4c-acb0-3142ba8ea00e','Global Risk Institute','<p>Financial institutions, governments, policymakers and regulators are all seeking growth and stability in an uncertain world. The Global Risk Institute in Financial Services (GRI) responds to the needs of the private and public sectors for better intelligence, information and training regarding risk in the financial services sector.</p>\n<p>Founded by the public and private sectors in Canada and now expanding internationally, GRI’s mandate is to develop applied and integrative research in financial risk and enhance risk education for organizations around the world. Through its research and education programs, GRI builds integrated risk management capacity for private and public sector risk professionals and acts as a hub, stimulating evidence-based debate between regulators, practitioners and academics engaged in risk.</p>\n<p>Cutting across industry sub-sectors and the different vantage points of the private sector, regulators, central banks and academia, GRI creates new approaches to risk. We also help our member organizations build innovative and practical strategies that better manage the balance between risk and opportunity in financial services.</p>\n<p>To find out more about GRI’s work, visit: <a href=\"http://www.globalriskinstitute.org/\" target=\"_blank\" rel=\"noreferrer noopener\">www.globalriskinstitute.org</a>​</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
