	(97,'field',38,2,' privacy policy '),
	(97,'field',39,2,' your privacy is important to us this privacy policy covers the information you provide to us online through our website located at www tfsa ca site it also explains how we use cookies and similar technologies by visiting our site you agree to be bound by the terms of this privacy policy collection and use we collect the personal information you provide us when you make an inquiry through our site we use the information only to answer your questions and respond to your requests when you visit our site we collect technical data including your ip address the browser you used to view our site your operating system screen resolution location language settings the site you came from and your keyword search we aggregate this technical data and use it to improve our site we do not combine this technical data with your personal information you can block the use of cookies by activating the settings in your browser but if you choose to block cookies you may not be able to access all or part of our site sharing we do not sell or rent your personal information to any third party we share your personal information with third party service providers that we engage to help us with our site or business these service providers are subject to confidentiality agreements with us and other legal restrictions that prohibit their use of your personal information for any purpose other than to assist us with our site or business we might be required to provide your personal information in response to a valid court order subpoena government investigation or as otherwise required by law we might report to law enforcement agencies any activities that we in good faith believe to be unlawful we might release your personal information when we believe that such release is reasonably necessary to protect the rights property and safety of others and ourselves in some cases your personal information may be processed or stored outside canada and available to government authorities under lawful orders and laws applicable there security we use reasonable security measures to protect your personal information from unauthorized access please be careful when sending your personal information to us through e mail e mail is not a secure means of transferring information we cannot guarantee that emailed information will not be lost or stolen accountability we comply with this privacy policy and applicable privacy laws if you send us a written complaint we will contact you to follow up we will work with the appropriate privacy commissioner to resolve any complaints that we cannot resolve directly with you change of privacy policy if we change our privacy policy we will post a revised policy on this site regardless of any change we make to our privacy policy we will only use your personal information in accordance with the version in place at the time your personal information was provided to us unless we have express consent to do otherwise contact person if you have questions or concerns about this privacy policy our privacy practices or your personal information please contact ktam tfsa ca if you ask us to delete your personal information unless restricted by law we will take reasonable steps to functionally delete your personal information from our database although we may keep a copy for archival purposes for as long as necessary in our opinion in compliance with applicable laws we will respond to your questions or concerns within 30 business days before we can respond we might ask you to verify your identity and to provide other details in a secure manner to help us to respond to your request this privacy policy was last updated on april 15 2016 '),
