	(654,'field',187,2,' sophie gupta is a principal at yaletown partners an impact focused venture capital fund manager that invests in businesses developing technologies to digitally transform traditional industries by prioritizing climate resilient growth for an innovative and sustainable future in addition to her work as an investment professional sophie is the co founder of the gupta family foundation mandated to support the empowerment of girls and women through educational and economic advancement opportunities sophie has served on the board of directors of the match international women s fund and the canadian women s foundation she is currently the co chair of the canadian venture capital association s cvca diversity and inclusion committee and serves on the board of engineers without borders sophie holds a bachelor of laws from universite laval as well as an honours bachelor of commerce specializing in international business from the university of ottawa and lives in montreal quebec '),
