	(448,'field',38,1,' banking '),
	(448,'field',39,1,' toronto is home to the world s soundest banks according to the banker s 2017 report on international financial centres toronto ranked eighth overall and among the world s top 10 for total bank assets the canadian banking industry headquartered in toronto is an essential contributor to the economic growth and well being of the city canada s five largest domestic banks have their head offices in toronto of the 50 foreign based banks operating in canada 44 have their canadian head offices in the toronto region the industry is also a major employer representing almost half of total employment within the city s financial sector the canadian system has two primary regulators the office of the superintendent of financial institutions osfi for prudential regulation and the financial consumer agency of canada fcac for financial consumer matters coupled with a strong working relationship among regulators the industry and government the stability and effectiveness of our regulatory framework makes toronto an attractive banking environment '),
	(448,'field',61,1,''),
	(448,'slug',0,1,''),
	(449,'field',38,1,' asset management '),
	(449,'field',39,1,' toronto has a large pool of competitive asset management companies and expertise it has ranked ninth in the world for its specialty in investment management and ninth in professional services gfci 20 2016 toronto is also home to three of the world s 60 largest pension funds canada pension plan cpp investment board ontario teachers pension plan and omers which combined have more than $300 billion in assets under management toronto s large pension funds have a worldwide reputation for excellence in governance risk management and innovative approaches to asset management the canadian pension system has been ranked 6th overall in the melbourne mercer global pension index toronto also has a leading edge thinking and research on pension management through international centre for pension management the icpm is a global think tank that fosters more effective pension design and management through research publications forums and governance education more than 30 international pension organizations contribute to the centre '),
	(449,'field',61,1,''),
	(449,'slug',0,1,''),
	(450,'field',38,1,' insurance '),
	(450,'field',39,1,' the strongest and most globally oriented insurance industries in the world are taking place in toronto it is continuously developing innovative products to reflect and anticipate the changing consumer needs and expectations over 60 life and health insurers have their head offices in the toronto region three of these firms manulife financial sun life financial and great west lifeco rank among the top 15 in the world based on market capitalization with over $740 billion in long term investments in canada the industry is one of the country s most important sources of long term capital and employment '),
	(450,'field',61,1,''),
	(450,'slug',0,1,''),
	(451,'field',38,1,' mining energy and clean tech '),
	(451,'field',39,1,' toronto is the mine financing capital of the world it is also a global centre for related legal accounting engineering and geological expertise toronto stock exchange tsx and the tsx venture exchange tsxv are 1 among exchanges worldwide in number of mining companies listed 1 among exchanges worldwide in equity capital raisedhome to 43 per cent of the world s public mining companiesglobal leaders in the number of listed oil and gas and clean technology companiesfinancing a cleaner greener future the tsx and tsxv in 2015 saw 29 new mining listings40 billion shares traded$6 8 billion in equity capital raised representing 90 per cent of all global equity financings '),
	(451,'field',61,1,''),
	(451,'slug',0,1,''),
	(452,'field',38,1,' fintech '),
	(452,'field',39,1,' location tech talent and competitive business environment toronto has all the ingredients to create a world class fintech cluster more than 13 000 tech companies in the toronto region from startups to global technology leaders deliver hardware software and communications services to the north american and global financial services industry a recent deloitte report ranked canada has the 4th largest cybersecurity hub in terms of deal flow with ontario leading the country the toronto region is the canadian headquarters for some of the world s leading wireless and telecom companies including cisco ericsson and alcatel and for world leading software and data analytics companies such as hp ibm and microsoft together these companies contribute to ontario s nation leading ict sector which accounts for 65% of the sector s r d and 66% of its exports in canada with 50% of the country s approximate 60 000 fintech employees the toronto region offers one of the most highly educated workforces in the developed world while more than 80% of toronto s financial services workers have post secondary degrees and accreditations the city s 61 technology related programs train more than 5 000 graduates a year toronto s talent pipeline is continually replenished by ontario s 44 colleges and universities that produce approximately 38 000 skilled graduates in science technology engineering and mathematics each year they also offer more than 200 cooperative education programs in ict fields including the university of waterloo s program the largest in the world involving 19 000 students and 6 300 employers fintech companies doing business in toronto benefit from one of the lowest software development costs in the industrialized world running a software development centre in toronto is much more affordable than in london and new york city which is one of the many reasons why the canadian software industry has grown 23% from 2009 to 2014 based on the combined costs of labour utilities telecommunications and property the cost of operating a data centre is also more affordable in toronto than other jurisdictions toronto s fintech sector can also take advantage of a broadly based system of r d tax credits from the federal and provincial governments these can reduce the gross cost of c$100 in r d to c$42 to c$54 depending on the size and type of company '),
	(452,'field',61,1,''),
	(452,'slug',0,1,''),
	(453,'field',38,1,' global risk institute '),
	(453,'field',39,1,' financial institutions governments policymakers and regulators are all seeking growth and stability in an uncertain world the global risk institute in financial services gri responds to the needs of the private and public sectors for better intelligence information and training regarding risk in the financial services sector founded by the public and private sectors in canada and now expanding internationally gri s mandate is to develop applied and integrative research in financial risk and enhance risk education for organizations around the world through its research and education programs gri builds integrated risk management capacity for private and public sector risk professionals and acts as a hub stimulating evidence based debate between regulators practitioners and academics engaged in risk cutting across industry sub sectors and the different vantage points of the private sector regulators central banks and academia gri creates new approaches to risk we also help our member organizations build innovative and practical strategies that better manage the balance between risk and opportunity in financial services to find out more about gri s work visit www globalriskinstitute org​ '),
	(453,'field',61,1,''),
	(453,'slug',0,1,''),
