	(460,'field',30,1,' fintech '),
	(460,'field',4,1,' toronto financial centre has a unique competitive advantage as the 2nd largest financial centre in north america located in the 3rd largest technology cluster on the continent innovation and technology are rapidly impacting the development and delivery of financial products and services and the ability of the financial community to access the highest quality technology talent and ideas is critical to success toronto s access to a vibrant technology ecosystem creates a compelling opportunity for the financial services industry in canada tfi leads collective initiatives and action which drive innovation in the financial services industry and establish the toronto financial centre as a leading hub for fintech business and talent '),
