	(462,'field',4,1,' toronto is a world leader in ai with ai pioneers like geoffrey hinton at the university of toronto and the establishment of the vector institute a new independent non profit research institution dedicated to ai global technology giants are all recognizing canada s leadership in ai adobe systems nvidia corp facebook microsoft uber google thales sa samsung fujitsu and lg electronics are all opening up ai labs in canada canada s global financial services firms are strongly supporting the ai ecosystem in canada rbc td manulife and thomson reuters have all made significant investments in ai talent in canada need links to their initiatives '),
