	(461,'field',6,1,' right '),
	(461,'field',30,1,' recent tfi initiatives in fintech '),
	(461,'field',4,1,' accelerating the growth of cybersecurity companies in ontario the cybersecurity fintech innovation pilot program cfipp is a one year $7 8 million initiative funded by the ministry of research innovation and science mris and delivered by ontario centres of excellence oce in collaboration with the toronto financial services alliance tfsa the program accelerates the growth of cybersecurity start up and scale up companies in ontario by partnering with financial institutions fis seeking innovative solutions to cybersecurity challenges and by providing them with cybersecurity talent israel ontario cybersecurity initiative the ontario centres of excellence oce and the israel innovation authority iia launched a new $20 million bilateral program both jurisdictions have committed $5m each over 5 years to support the ontario israel research network program magnet oirnp magnet for a total of $10m that is matched by participating smes cybersecurity in the financial services sector was identified as the focus area for the inaugural call for proposals oce and the toronto financial services alliance tfsa have identified toronto based financial institutions that have participated in this initiative '),
