	(464,'field',6,1,' left '),
	(464,'field',30,1,' cybersecurity '),
	(464,'field',4,1,' cyber security is increasingly driving innovation and economic activity in canada toronto region has world class talent and research institutions and cybersecurity is no exception for example the university of waterloo s institute for quantum computing is at the forefront of change by developing quantum safe cryptology tools cyber security contributes $1 7 billion to canada s gdp consisting of over 11 000 jobs canada and particularly toronto is global leader in cybersecurity toronto is the 4th most active country in the world for cybersecurity deals canada s national government is supporting our cybersecurity ecosystem and recently announced a comprehensive national strategy to make canada a global leader the strategy will support advanced research foster digital innovation develop cyber skills and knowledge work with partners to drive investment and foster cyber research and development focus on emerging areas of canadian excellence such as quantum computing and blockchain technologies and explore initiatives to ensure that canadian companies can bring their products to a global market and drive domestic demand for cyber security technologies and services '),
	(464,'field',31,1,''),
