	(465,'field',6,1,' right '),
	(465,'field',30,1,' driving a national fintech strategy '),
	(465,'field',4,1,' tfsa s ceo was appointed to the ontario government s advisory panel on fintech the panel is helping shape a fintech strategy that enhances ontario s position as a global leader and promotes growth that produces jobs and investment in the province see announcement '),
