	(466,'field',5,1,' text img ph2 '),
	(466,'field',6,1,' left '),
	(466,'field',30,1,' talent '),
	(466,'field',4,1,' the key to establishing the toronto region s competitiveness as a leading international financial centre lies in our ability to attract and retain world class talent tfi is committed to growing the pool of in demand work ready talent for the financial services fs sector we execute and publish action oriented research that helps to align the talent related efforts of employers educators and government we act as a catalyst identifying and strategizing about today s talent challenges to propose and lead system wide initiatives that benefit the fs sector as a whole we also act as a connector strengthening collaboration and building bridges between our partners within industry government and post secondary institutions to grow and sustain our long term talent advantage '),
