	(469,'field',30,1,' talent reports '),
	(469,'field',4,1,' unlocking the human opportunity future proof skills to move financial services forward a talent report to help understand the key trends shaping the fs sector how these trends are changing the nature of work and the impact any changes will have on the demand for specific skill sets part 2 of this research is in progress and will focus on a supply side solution to the challenge '),
