	(470,'field',6,1,' right '),
	(470,'field',30,1,' coordinated cybersecurity talent strategy '),
	(470,'field',4,1,' a collaborative tfi led approach to addressing the growing need for cyber professionals in the fs sector our first project the changing faces of cybersecurity closing the cyber risk gap was completed and launched recently in partnership with deloitte canada another project involving collaboration between fs employers and ontario s colleges is underway '),
