	(471,'field',5,1,' text img ph2 '),
	(471,'field',6,1,' left '),
	(471,'field',30,1,' career advisor website '),
	(471,'field',4,1,' career advisor is a dedicated talent site to effectively inform engage and support current and future fs job seekers with tailored resources '),
