	(472,'field',5,1,' text img ph2 '),
	(472,'field',6,1,' left '),
	(472,'field',30,1,' sustainable finance '),
	(472,'field',4,1,' the global demand for cleaner economic growth is opening up tens of trillions of dollars of opportunity around the world and toronto s financial sector will be required to play a leading role in order to unlock the potential of sustainable growth the cop 21 paris agreement signed by 185 countries in 2015 marked a turning point in the global fight against climate change the agreement was premised on the need to mobilise $100 billion annually between now and 2020 and a total $1 trillion by 2030 in order to keep global warming under 2 c in order to achieve this public and private funding will need to be aligned the financial sector will play a crucial role in helping to attract new pools of funding to projects that aim to mitigate and adapt to climate change the toronto financial centre and canada more broadly has the potential to establish itself as a leading north american hub for sustainable finance '),
	(472,'field',31,1,''),
	(472,'field',63,1,' 1 '),
	(472,'slug',0,1,''),
	(473,'field',5,1,' text img ph2 '),
	(473,'field',6,1,' right '),
	(473,'field',30,1,' sustainable finance in canada today '),
	(473,'field',4,1,' canada s federal government has set out ambitious targets and plans for reducing carbon emissions under its commitment to the paris agreement in april 2018 to support that commitment the government of canada announced the creation of an expert panel on sustainable finance which noted that accelerating action to support sustainable finance is an important part of canada s g7 presidency tfi is working with the financial sector to establish a strategy for the toronto financial centre s role in developing and growing sustainable finance in canada in order to capitalize on the economic opportunity that can be created by the transition to a low carbon economy '),
	(473,'field',31,1,''),
	(473,'field',63,1,' 1 '),
	(473,'slug',0,1,''),
	(474,'field',5,1,' text img ph2 '),
	(474,'field',6,1,' left '),
	(474,'field',30,1,' tfi sustainable finance strategy '),
	(474,'field',4,1,' build thought leadership on strategies and best practices to finance canada s transition to a low carbon economy promote awareness and action on initiatives which create more transparent and efficient markets with respect to sustainability objectives eg climate disclosure initiatives such as the task force for climate risk financial disclosure tcfd foster the development of a leading north american green finance market in the toronto financial centre to support projects and companies which aim to mitigate and adapt to climate change develop the toronto financial centre s role in global sustainable finance initiatives and standards through participation in key industry events and groups such as the international network of financial centres for sustainability '),
	(474,'field',31,1,''),
	(474,'field',63,1,' 1 '),
	(474,'slug',0,1,''),
	(475,'field',5,1,' text img ph2 '),
	(475,'field',6,1,' right '),
	(475,'field',30,1,' international network of financial centres for sustainability '),
	(475,'field',4,1,' tfi is participating in the un s international network of financial centres for sustainability fc4s and is currently the only representative from north america the fc4s network is a partnership between financial centres and the united nations environment programme the fc4s objective is to exchange experience and take common action on shared priorities to accelerate expansion of green and sustainable finance strengthen international connectivity and create framework for common approaches the fc4s network works across five thematic areas strengthening strategic commitment stimulating strategic action on guidance assessment tools and data systems boosting market integrity clarity and convergence on definitions taxonomies and classifications building capacity strengthening the capacity of developing financial centres and the skills base of financial practitioners fostering innovation pooling experience on critical issues such as fintech and digital finance solutions for sustainable finance markets serving the real economy exploring models to connect financial centres with real economy needs ex green finance zones the current fc4s five point action plan includes strengthen links among members including through regional hubs for europe asia and africa develop benchmarking and assessment tool to enable financial centres to evaluate their progress and inspire further action develop a joint statement on the importance of effective taxonomies for green and sustainable finance a common language for green and sustainable finance share experience on green digital finance ex green assets wallet gather experience of financial centres in the development of the green bond market more information about the fc4s can be found here '),
	(475,'field',31,1,''),
	(475,'field',63,1,' 1 '),
	(475,'slug',0,1,''),
	(476,'field',5,1,' infograph ph 3 '),
	(476,'field',6,1,' left '),
	(476,'field',30,1,' the global green finance index '),
	(476,'field',4,1,' ranked toronto s sustainable finance activity as globally diversified and relatively broad toronto is the only canadian centre in the index toronto is one of a few centres whose green finance offerings were most expected to improve significantly over the next two to three years a recent report by rbc and corporate knights estimated the canadian green bond market has the potential to top $50b annually '),
	(476,'field',31,1,''),
	(476,'field',63,1,' 1 '),
	(476,'slug',0,1,''),
	(477,'field',5,1,' text img ph2 '),
	(477,'field',6,1,' right '),
	(477,'field',30,1,' the clean technology market opportunity '),
	(477,'field',4,1,' toronto stock exchange ranks first globally in clean technology listings in the 2017 global cleantech innovation index canada ranked fourth globally scoring first for funding available '),
	(477,'field',31,1,''),
	(477,'field',63,1,' 1 '),
