	(478,'field',5,1,' text img ph2 '),
	(478,'field',6,1,' left '),
	(478,'field',30,1,' climate related financial disclosure '),
	(478,'field',4,1,' investors are increasingly demanding that climate risks be adequately disclosed and addressed by companies several initiatives have been developing globally to establish best in class disclosure principles read more in 2017 mark carney governor of the bank of england and michael bloomberg former mayor of new york city led the launch of an international task force on climate related financial disclosure tcfd many of canada s largest financial institutions are supporters of the task force on climate related financial disclosures tcfd last year two of canada s largest banks td and rbc joined a global network of the world s leading banks in a pilot project working to implement the final recommendations by tcfdat the 2018 g7 in canada several canadian institutional investors agreed to speeding up the implementation of uniform and comparable climate related disclosures under the fsb tcfd framework the canadian securities administrators csa released a report that summarizes the findings of the csa s previously announced project to review the disclosure by reporting issuers of risks and financial impacts associated with climate change the csa intends to develop new guidance and initiatives to educate issuers about the disclosure of climate change related risks opportunities and financial impacts the 2016 canadian responsible investment trends report reveals that canada s responsible investment ri market is continuing to experience rapid growth responsible investment refers to the incorporation of environmental social and corporate governance esg factors into the selection and management of investments the report noted recent trends in canada s responsible investment marketplace such as $1 5 trillion in responsible investment assets under management49% increase in two yearsresponsible investing represents 38% of canadian investment industryesg integration surpasses engagement as leading ri strategyindividual investors ri assets up 91% in two yearspension fund assets make up 75% of ri industry s growth increasing by $374 billion or 45% in two years80% of respondents expect moderate to high levels of growth in ri over next two yearsasset managers and owners ranked the following as their top motivations for incorporating esg factors into investment decisions 1 to minimize risk over time 2 to improve returns over time 3 to fulfill fiduciary duty '),
	(478,'field',31,1,''),
	(478,'field',63,1,' 1 '),
	(478,'slug',0,1,''),
