	(481,'field',30,1,' success stories '),
	(481,'field',4,1,' discover why financial services companies continue to choose toronto for growth and expansion axiomsl as a global leader in risk data management and regulatory reporting solutions for the financial industry axiomsl counted several canadian banks among its customers and so decided they needed to have boots on the ground in the business capital of canada robert walters with the opening of their toronto office in 2016 recruitment consultancy robert walters now has a presence in 27 countries as a growing financial hub toronto is an important new market for robert walters offering a highly skilled workforce and a dynamic business environment cohere communications with over 50 employees in offices across north america cohere has seen the need to maintain a small presence in toronto for several years ortec finance find out why ortec finance chose toronto has their home base in north america banco base a mexican bank finds a niche in canada s financial marketplace infrasoft technologies limited our market in canada is relationship oriented says mirjankar one of the founding partners of infrasofttech we need a local operation here we cannot run it from india the customers are different the approach is different if you try to run it by remote control it won t work we need to be here we need to be seen working closely with our customers operis toronto won hands down against other north american cities there s more p3 activity in toronto costs are more reasonable and work permits were easier to arrange dnm analytics with 65 employees and with two canadian clients already using the company s services dnm expanded its global operations in january of 2014 opening its first north american office in toronto pts consulting it just made sense for us to locate our canadian office here says ian oliver director at pts consulting canada limited if you re going to operate in the financial services sector in this country then you really need to be in toronto payvision most of payvision s current and potential partners are located in toronto as well and the city s location enables clients and personnel to travel between payvision s canadian and u s offices in new york in about an hour and a half fdm group but in all the locations where we ve opened an office i ve never experienced the welcome that we ve received in toronto says sheila flavell the company s chief operating officer excelian the availability of high quality talent with a range of skills and expertise was a crucial factor to helping excelian make the decision to expand into the toronto market globalvcard inc when csi enterprises began planning for expansion into canada it didn t take long to identify toronto as a prime location for its canadian office apex fund services apex fund services is expanding its toronto based canadian subsidiary to offer specialized services to canadian fund managers such as international best practices real time middle office administrative services and operation risk reporting services industrial and commercial bank of china to better serve the fast growing canada china trade and investment market the industrial and commercial bank of china limited established its canadian head office in toronto s financial district '),
