	(631,'field',153,1,' what are cookies and why do we use them cookies are small text files that are placed onto your computer by websites and or applications that you visit cookies are used to help us improve your experience when using our websites for example storing your preferred language setting for the next time you visit the information we collect from cookies enables us to tailor our websites to your personal needsremember the notifications that you have been shown so that you are not shown them againmake improvements and updates to our websites based on the way you want to use themwe generally do not use cookies to identify you personally what kind of cookies do we use we use the following categories of cookies category 1 necessary cookiesnecessary cookies enable you to use our websites and all their features such as enabling access to secure areas of the website without these cookies you may not be able to use all the features of our websites category 2 performance cookiesperformance cookies collect information about how you use our websites so we can improve them for you in future for example they collect information on which pages you visit most often and any error messages you may get the information collected by these cookies is anonymous they do not collect any information that can identify you personally google analytics universal we are using google universal analytics to monitor our website performances and check visitor activities to adapt our content based on their expectationshotjar we are using hotjar to validate that our website design and user experience are performing as expected and offer the best possible experience to our visitors we also use it to perform surveys on pages and collect visitor feedback when they want to share it with uscategory 3 functionality cookiesfunctionality cookies enable us to provide you with a more personalized experience they help us to remember data such as your username and language preference to save you having to enter them again the next time you visit the information these cookies collect is anonymous they cannot track your browsing activity on other websites category 4 targeting advertising cookieswe and our service providers may use advertising cookies to deliver ads that we believe are relevant to you and your interests for example we may use targeting or advertising cookies to customize the advertising and content you receive on our websites to limit the number of times you see the same ad on our websites and to help measure the effectiveness of our advertising campaigns facebook pixel we use facebook pixel tracking to measure social media campaign efficiency related to the facebook platformno personally identifiable information is stored in any of the platforms mentioned above category 5 social media cookieswe use third party cookies from social media sites such as facebook twitter and linkedin to enable in depth campaign reporting and to track social network users when they visit our websites by using a tagging mechanism provided by those social networks these cookies can also be used for event tracking and remarketing purposes any data collected with these tags will be used in accordance with the privacy policy and with the social network s privacy policies we will not collect or store any personally identifiable information from the user linkedin we use linkedin tracking to measure social media campaign efficiency related to the linkedin platformtwitter we use twitter tracking to measure social media campaign efficiency related to the twitter platformdetails of how you can opt out of accepting these cookies are found in the following links twitterlinkedin '),
	(631,'field',153,2,' que sont les cookies et pourquoi les utilisons nous les cookies sont de petits fichiers texte installes sur votre ordinateur par les sites web et ou les applications que vous visitez ou utilisez les cookies nous permettent d ameliorer l experience de l utilisateur sur nos sites web ainsi nous pouvons par exemple memoriser vos options de langue pour votre prochaine visite les informations collectees par les cookies nous permettent d adapter nos sites web a vos besoins personnels de memoriser les notifications que vous avez visualisees afin qu elles ne s affichent plus d ameliorer et de mettre a jour nos sites web en fonction de vos attentes concernant leur utilisation nous n utilisons generalement pas de cookies permettant de vous identifier personnellement quels types de cookies utilisons nous nous utilisons les categories de cookies suivantes categorie 1 cookies necessairesles cookies necessaires vous permettent de naviguer sur nos sites web et de profiter de leurs fonctionnalites par exemple pour acceder aux espaces securises du site sans ces cookies vous ne pourriez pas profiter de toutes les fonctionnalites de nos sites web categorie 2 cookies de performanceles cookies de performance collectent des informations sur la maniere dont vous utilisez nos sites web et nous permettent de les ameliorer a l avenir par exemple ils collectent des informations sur les pages que vous visitez le plus et sur les messages d erreur que vous pouvez rencontrer les informations recueillies par ces cookies sont completement anonymes ils ne collectent aucune information qui pourrait permettre de vous identifier personnellement google analytics universal nous utilisons google universal analytics pour suivre les performances de notre site web et l activite des visiteurs afin d adapter notre contenu a leurs attentes hotjar nous utilisons hotjar pour valider la conception de notre site web et verifier que l experience utilisateur est conforme aux attentes et que le site offre la meilleure experience possible a nos visiteurs nous l utilisons egalement pour realiser des sondages sur nos pages et collecter des retours d utilisateurs lorsque ces derniers acceptent de nous en faire part categorie 3 cookies fonctionnelsles cookies fonctionnels nous permettent de vous offrir une experience plus personnalisee ils sont utilises pour memoriser des informations telles que votre nom d utilisateur ou vos choix de langue afin de vous eviter de saisir ces donnees a chaque visite les informations recueillies par ces cookies sont completement anonymes ils ne peuvent en aucun cas enregistrer vos donnees de navigation sur d autres sites web categorie 4 cookies publicitaires ciblesnous et nos prestataires de services pouvons utiliser des cookies publicitaires pour vous presenter des publicites qui selon nous peuvent vous correspondre et correspondre a vos centres d interet par exemple nous pouvons utiliser des cookies publicitaires cibles pour personnaliser la publicite et le contenu que vous recevez sur nos sites web pour limiter le nombre de fois qu une meme publicite vous est proposee sur nos sites et pour nous aider a evaluer l efficacite de nos campagnes publicitaires facebook pixel nous utilisons le traceur de pixels facebook pour mesurer l efficacite des campagnes de reseau social sur la plateforme facebook aucune information permettant de vous identifier personnellement n est stockee sur aucune des plateformes mentionnees ci dessus categorie 5 cookies de reseaux sociauxnous utilisons des cookies tiers issus de facebook twitter et linkedin pour obtenir des rapports de campagne detailles et suivre les usagers des reseaux sociaux lorsqu ils visitent nos sites web en utilisant un mecanisme de balisage fourni par ces reseaux sociaux ces cookies peuvent aussi etre utilises pour suivre des evenements ou a des fins de reciblage publicitaire toutes les donnees collectees a l aide de ces balises seront utilisees conformement a la politique de confidentialite et aux politiques de confidentialite des reseaux sociaux les sites web de sgs ne collectent et ne conservent aucune information a caractere personnel de l utilisateur linkedin nous utilisons le suivi linkedin pour mesurer l efficacite des campagnes de reseau social sur la plateforme linkedin twitter nous utilisons le suivi twitter pour mesurer l efficacite des campagnes de reseau social sur la plateforme twitter pour savoir comment vous pouvez faire le choix de ne plus accepter ces cookies consultez les liens suivants twitterlinkedin '),
