	(622,'field',1,1,' about heading the time is now for canada to demonstrate leadership to the world and amplify women s voices the equality fund will support women s movements driving the cultural economic and political changes required to make gender equality a reality individusinvestisseurs institutionnelssocietesfondations philanthropiques contact the time is now for canada to demonstrate leadership to the world and amplify women s voices the equality fund will support women s movements driving the cultural economic and political changes required to make gender equality a reality enter your email to learn more about investing in this fund and participating in the movement towards equality feminist grant making the equality fund s core work will be supporting women s rights organizations and feminist movements globally we will provide financial resources support capacity building and accompany organizations at the grassroots national and international levels changing and transforming unequal power structures will be at the core of our actions grounded in feminist principles grant making will support the priorities identified by feminist activists and organizations while adopting an intersectional approach we will shift decision making power to southern organizations by using innovative processes such as participatory grant making learning and progress will be accelerated through feminist evaluation and inclusive processes impact and gender lens investing fund the equality fund will use social finance as a tool to deploy investment capital to scale systems transformation for gender equality while generating risk adjusted market returns for investors through a holistic approach to gender lens investing we will lean on the best practices of impact investing as well as traditional investing combined with a deep understanding of the global issues that perpetuate gender inequalities moreover the equality fund will promote capacity building by providing its investees with the best resources training and guidance in pursuit of accelerating the achievement of the equality fund s mission pexels photo 814499 the match international women s fund the match fund is canada s only global fund for women girls and trans people the match fund will leverage its cutting edge feminist grant making experience as well as its canadian philanthropy expertise to lead the design and build of the equality fund in collaboration with its consortium partners lesley fennelly jennifer reynolds susann rentzsch timeline january 2019 the equality fund team responds to the government of canada s call it is eager to partner with the government as well as canadians international donors and investors to fund systemic change for women girls and trans people december 17 2018 global affairs canada releases a call for an expression of interest to catalyze new investments in support of gender equality and women s rights in developing countries november 2018 a consortium of well respected organizations is assem bled to build out the design structure policies and governing principles of the equality fund august 2018 the equality fund team ramps up its commitment and brings in world class experts to lead each of the philanthropy grant making and impact investment streams this work is incubated by the match fund the equality fund team responds to the call of the government of canada she looks forward to joining the government as well as canadians donors and international investors to fund the achievement of systemic change for women girls and trans people private investors peopleinstitutional investorscompaniesphilanthropic foundations private investors peopleinstitutional investorscompaniesphilanthropic foundations private investors peopleinstitutional investorscompaniesphilanthropic foundations private investors eqf logo private investors eqf logo private investors peopleinstitutional investorscompaniesphilanthropic foundations '),
