h the best resources training and guidance in pursuit of accelerating the achievement of the equality fund s mission pexels photo 814499 the match international women s fund the match fund is canada s only global fund for women girls and trans people the match fund will leverage its cutting edge feminist grant making experience as well as its canadian philanthropy expertise to lead the design and build of the equality fund in collaboration with its consortium partners leadership lesley fennelly jennifer reynolds susann rentzsch a world in which women girls and trans people realize their economic political social cultural and reproductive rights timeline january 2019 the equality fund team responds to the government of canada s call it is eager to partner with the government as well as canadians international donors and investors to fund systemic change for women girls and trans people december 17 2018 global affairs canada releases a call for an expression of interest to catalyze new investments in support of gender equality and women s rights in developing countries november 2018 a consortium of well respected organizations is assem bled to build out the design structure policies and governing principles of the equality fund august 2018 the equality fund team ramps up its commitment and brings in world class experts to lead each of the philanthropy grant making and impact investment streams this work is incubated by the match fund the equality fund team responds to the call of the government of canada she looks forward to joining the government as well as canadians donors and international investors to fund the achievement of systemic change for women girls and trans people private investors peopleinstitutional investorscompaniesphilanthropic foundations private investors peopleinstitutional investorscompaniesphilanthropic foundations private investors peopleinstitutional investorscompaniesphilanthropic foundations private investors eqf logo private investors eqf l