	(649,'field',179,2,' feminist grant making the equality fund s core work will be supporting women s rights organizations and feminist movements globally we will provide financial resources support capacity building and accompany organizations at the grassroots national and international levels changing and transforming unequal power structures will be at the core of our actions grounded in feminist principles grant making will support the priorities identified by feminist activists and organizations while adopting an intersectional approach we will shift decision making power to southern organizations by using innovative processes such as participatory grant making learning and progress will be accelerated through feminist evaluation and inclusive processes impact and gender lens investing fund the equality fund will use social finance as a tool to deploy investment capital to scale systems transformation for gender equality while generating risk adjusted market returns for investors through a holistic approach to gender lens investing we will lean on the best practices of impact investing as well as traditional investing combined with a deep understanding of the global issues that perpetuate gender inequalities moreover the equality fund will promote capacity building by providing its investees with the best resources training and guidance in pursuit of accelerating the achievement of the equality fund s mission pexels photo 814499 the match international women s fund the match fund is canada s only global fund for women girls and trans people the match fund will leverage its cutting edge feminist grant making experience as well as its canadian philanthropy expertise to lead the design and build of the equality fund in collaboration with its consortium partners '),
