INSERT INTO `craft_stc_21_items` (`id`, `elementId`, `siteId`, `dateCreated`, `dateUpdated`, `uid`, `field_heading`, `field_text`)
VALUES
	(1,650,2,'2019-02-03 20:06:46','2019-02-03 20:50:02','723bbe6d-4db9-4ea4-989f-139d65590a0f','FEMINIST GRANT-MAKING','<p>The Equality Fund\'s core work will be supporting women\'s rights organizations and feminist movements globally. We will provide financial resources, support capacity building, and accompany organizations at the grassroots, national and international levels. Changing and transforming unequal power structures will be at the core of our actions.</p>\n<p>Grounded in feminist principles, grant-making will support the priorities identified by feminist activists and organizations while adopting an intersectional approach. We will shift decision-making power to southern organizations by using innovative processes such as participatory grant-making. Learning and progress will be accelerated through feminist evaluation and inclusive processes.</p>'),
	(2,650,1,'2019-02-03 20:06:46','2019-02-03 20:50:02','35160015-408c-490b-a6b5-1aa5de6c2ea6','FEMINIST GRANT-MAKING','<p>The Equality Fund\'s core work will be supporting women\'s rights organizations and feminist movements globally. We will provide financial resources, support capacity building, and accompany organizations at the grassroots, national and international levels. Changing and transforming unequal power structures will be at the core of our actions.</p>\n<p>Grounded in feminist principles, grant-making will support the priorities identified by feminist activists and organizations while adopting an intersectional approach. We will shift decision-making power to southern organizations by using innovative processes such as participatory grant-making. Learning and progress will be accelerated through feminist evaluation and inclusive processes.</p>'),
	(3,651,2,'2019-02-03 20:06:46','2019-02-03 20:50:02','53a71cb8-3c5c-48df-94e1-1dbebc9c1fcb','IMPACT AND GENDER-LENS INVESTING FUND','<p>The Equality Fund will use social finance as a tool to deploy investment capital to scale systems transformation for gender equality, while generating risk-adjusted market returns for investors.</p>\n<p>Through a holistic approach to gender-lens investing, we will lean on the best practices of impact investing as well as traditional investing, combined with a deep understanding of the global issues that perpetuate gender inequalities.</p>\n<p>Moreover, the Equality Fund will promote capacity building by providing its investees with the best resources, training, and guidance, in pursuit of accelerating the achievement of the Equality Fund’s mission.</p>'),
	(4,651,1,'2019-02-03 20:06:46','2019-02-03 20:50:03','785bc87a-abb4-4efc-a9ee-c532cbfe3ef8','IMPACT AND GENDER-LENS INVESTING FUND','<p>The Equality Fund will use social finance as a tool to deploy investment capital to scale systems transformation for gender equality, while generating risk-adjusted market returns for investors.</p>\n<p>Through a holistic approach to gender-lens investing, we will lean on the best practices of impact investing as well as traditional investing, combined with a deep understanding of the global issues that perpetuate gender inequalities.</p>\n<p>Moreover, the Equality Fund will promote capacity building by providing its investees with the best resources, training, and guidance, in pursuit of accelerating the achievement of the Equality Fund’s mission.</p>'),
	(5,652,2,'2019-02-03 20:06:46','2019-02-03 20:50:03','bde65d9e-8811-4890-ba60-42b231d092a1',NULL,'<p>The MATCH International Women’s Fund (The MATCH Fund) is Canada’s only global fund for women, girls, and trans* people.</p>\n<p>The MATCH Fund will leverage its cutting-edge feminist grant-making experience, as well as its Canadian philanthropy expertise to lead the design and build of the Equality Fund in collaboration with its consortium partners.</p>'),
	(6,652,1,'2019-02-03 20:06:46','2019-02-03 20:50:03','89eea8d5-f7c8-4b4e-afdc-c7a0931d985b',NULL,'<p>The MATCH International Women’s Fund (The MATCH Fund) is Canada’s only global fund for women, girls, and trans* people.</p>\n<p>The MATCH Fund will leverage its cutting-edge feminist grant-making experience, as well as its Canadian philanthropy expertise to lead the design and build of the Equality Fund in collaboration with its consortium partners.</p>');
INSERT INTO `craft_stc_23_items` (`id`, `elementId`, `siteId`, `dateCreated`, `dateUpdated`, `uid`, `field_heading`, `field_text`)
VALUES
	(1,657,2,'2019-02-03 20:36:56','2019-02-03 20:50:03','f9356bc5-4150-404c-ae4b-025ab2c526b9','JANUARY 2019','<p>The Equality Fund team responds to the Government of Canada’s call. It is eager to partner with the Government, as well as Canadians, international donors and investors, to fund systemic change for women, girls and trans* people.</p>'),
	(2,657,1,'2019-02-03 20:36:56','2019-02-03 20:50:03','f00bb43d-084d-49a2-bd3b-c0e50eadab76','JANUARY 2019','<p>The Equality Fund team responds to the Government of Canada’s call. It is eager to partner with the Government, as well as Canadians, international donors and investors, to fund systemic change for women, girls and trans* people.</p>'),
	(3,658,2,'2019-02-03 20:36:56','2019-02-03 20:50:03','dec863f7-ffb6-4493-996b-96e37026f009','DECEMBER 17, 2018','<p>Global Affairs Canada releases a call for an Expression of Interest to catalyze new investments in support of gender equality and women’s rights in developing countries.</p>'),
	(4,658,1,'2019-02-03 20:36:56','2019-02-03 20:50:03','e7ff8a0b-ed6b-471d-a377-b23533df83f1','DECEMBER 17, 2018','<p>Global Affairs Canada releases a call for an Expression of Interest to catalyze new investments in support of gender equality and women’s rights in developing countries.</p>'),
	(5,659,2,'2019-02-03 20:36:56','2019-02-03 20:50:03','d4eed765-3cf1-4001-be19-d494da206adf','NOVEMBER 2018','<p>A consortium of well-respected organizations is assem- bled to build out the design structure, policies and governing principles of the Equality Fund.</p>'),
	(6,659,1,'2019-02-03 20:36:56','2019-02-03 20:50:03','c9034cf5-ca9d-4bda-97ab-76d55c9c444f','NOVEMBER 2018','<p>A consortium of well-respected organizations is assem- bled to build out the design structure, policies and governing principles of the Equality Fund.</p>'),
	(7,660,2,'2019-02-03 20:36:56','2019-02-03 20:50:03','67ddb1f8-03bd-4504-9882-69b304d88826','AUGUST 2018','<p>The Equality Fund team ramps up its commitment, and brings in world-class experts to lead each of the philanthropy, grant-making and impact investment streams. This work is incubated by The MATCH Fund.</p>'),
	(8,660,1,'2019-02-03 20:36:56','2019-02-03 20:50:03','c006e468-2712-4dea-843b-92ecb7747967','AUGUST 2018','<p>The Equality Fund team ramps up its commitment, and brings in world-class experts to lead each of the philanthropy, grant-making and impact investment streams. This work is incubated by The MATCH Fund.</p>');
